import React from 'react';
import './Todo.css';

const Todo = ({ todo,handleToggle }) => {
    const handleClick = (id) => {
        handleToggle(id);
    }
    return (
        <div className = {todo.complete ? 'strike' : ""} onClick={handleClick(todo.id)}>
            {todo.task}
        </div>
    )
}

export default Todo;
